import './App.css';
import Header from './components/Header';
// import Footer from './components/Footer';
import Home from './components/Home';
import About from './components/About';
import Services from './components/Services';
import Contact from './components/Contact';
import Login from './components/Login';
import SignUp from './components/SignUp';
import Team from './components/Team';
// import React, {useState} from 'react'
import { BrowserRouter, Routes, Route} from 'react-router-dom';
import Photos from './components/Photos';
import Travelling from './components/Travelling';
import RentalCars from './components/RentalCars';
import Departure from './components/Departure';
import TourNORTH from './components/TourNORTH';
import TourSOUTH from './components/TourSOUTH';
import TourEAST from './components/TourEAST';
import TourWEST from './components/TourWEST';
import RentalCar_Booking from './components/RentalCar_Booking';
import GetQuote from './components/GetQuote';


function App() {
  const [isDarkMode, setIsDarkMode] = useState(true);

  const toggleDarkMode = () => {
    setIsDarkMode(!isDarkMode);
  };
  return (
    <>
    <div className={isDarkMode ? 'dark-mode' : 'light-mode'}>
     <BrowserRouter>
      <Header/>
      <Routes>
        <Route path="/" Component={Home}/>
        <Route path="/contact" Component={Contact}/>
        <Route path="/about" Component={About}/>
        <Route path="/services" Component={Services}/>
        <Route path="/login" Component={Login}/>
        <Route path="/signUp" Component={SignUp}/>
        <Route path="/team" Component={Team}/>
        <Route path="/photos" Component={Photos}/>
        <Route path="/travelling" Component={Travelling}/>
        <Route path="/rentalCars" Component={RentalCars}/>
        <Route path="/departure" Component={Departure}/>
        <Route path="/tourNorth" Component={TourNORTH}/>
        <Route path="/tourSouth" Component={TourSOUTH}/>
        <Route path="/tourEast" Component={TourEAST}/>
        <Route path="/tourWest" Component={TourWEST}/>
        <Route path="/rentalCar_Booking" Component={RentalCar_Booking}/>
        <Route path="/GetQuote" Component={GetQuote}/>
      </Routes>
    </BrowserRouter>
    <button onClick={toggleDarkMode}>
        {isDarkMode ? 'dark' : 'light'}
      </button>
    </div>
    </>
  );
};

export default App;
